import {userActionEnum} from "../reducers/user/types";

export const userActionCreators = {
    ASetAuth: (payload) => ({type: userActionEnum.SET_AUTH, payload}),
    ASetUser: (payload) => ({type: userActionEnum.SET_USER, payload})
}
